<b><i>CategoryAccountMappingList</i></b><br />
The QBFC list object that contains one or more CategoryAccountMapping objects, used to map one or more QuickBooks accounts to
a particular form 1099 box (or "Category" in SDK parlance). Multiple accounts can be mapped to the same 1099 box.
